B&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; font-size: 24px;\">愿景：</span><div><h4 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90);\">最受尊敬的企业咨询服务企业</h4><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90); font-size: 14px;\">不断倾听和满足用户需求，引导并超越用户需求，赢得用户尊敬。 通过提升品牌形象，使员工具有高度企业荣誉感，赢得员工尊敬。 推动物流行业的健康发展，与合作伙伴共成长，赢得行业尊敬。 注重企业责任，用心服务，关爱社会、回馈社会，赢得社会尊敬。</p><h3 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90); font-size: 24px;\">使命：</h3><h4 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90);\">通服务提升人类生活品质</h4><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90); font-size: 14px;\">使服务像水和电融入人们的生活，为人们带来便捷和愉悦。 关注不同地域、群体，并针对不同对象提供差异化的产品和服务。 打造开放共赢平台，与合作伙伴共同营造健康的生态环境。</p><h3 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90); font-size: 24px;\">管理理念：</h3><h4 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90);\">关心员工成长</h4><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90); font-size: 14px;\">为员工提供良好的工作环境和激励机制。 完善员工培养体系和职业发展通道，使员工与企业同步成长。 充分尊重和信任员工，不断引导和鼓励，使其获得成就的喜悦。</p><h3 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90); font-size: 24px;\">价值观：</h3><h4 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90);\">正直+进取+合作+创新</h4><h3 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90); font-size: 24px;\">经营理念：</h3><h4 style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; color: rgb(90, 90, 90);\">一切以用户价值为</h4></div>','2','0','2018-03-09 09:57:18','2018-03-08 12:16:43');
