INSERT INTO `t_news` VALUES ('1','2016年人才测评公司最新排名','人才测评公司最新排名','人才测评公司最新排名','1',NULL,'/image/brand/2020/03/22/15/3d0a6e5a-554b-4e13-b351-50f622821048.jpg','<p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; line-height: 30px; text-indent: 2em; text-align: justify; color: rgb(90, 90, 90); font-size: 14px;\">人才管理这一概念是出现于90年代，许多企业用来招募、发展和保留人才，通过人才来驱动公司的业绩。21世纪对TM有不同的定义：Morton（2006）描述了人才管理活动的八个类别：招聘，保留，发展，领导力开发，绩效管理，雇员反馈/测量，人才规划与文化。Fitz-enz (2005)认为人才管理囊括了六个人力资源服务：聘用与安置, 领导力发展，继任，绩效管理，培训和教育以及保留。 Farley (2005) 提出，人才管理是发挥员工价值的一套流程，人才管理的定义的核心议题就变成了“吸引、聘任、培养和保留人才”。</p><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; line-height: 30px; text-indent: 2em; text-align: justify; color: rgb(90, 90, 90); font-size: 14px;\">NO1 DDI成立于美国的DDI (Development Dimensions International )是全球领先的人力资源咨询公司。目前，在全球26个国家的78家办事处拥有1200多名顾问和执行支持人员。凭借对地方文化和商业运作的精确诠释，DDI为企业提供企业本土市场发展策略的传承管理和领导团队发展方案，帮助企业改善客户服务、减少员工离职、提升生产效率、提高投资回报率，实现竞争优势。 自1970年成立以来，DDI已经在全世界发掘和发展了超过2000万名主管和领导人才。每天，平均有10000人通过DDI的选才系统得到聘用或升职。1970年，两位心理学博士William C. Byham博士和Douglas W. Bray博士在美国创建了Development Dimensions International （DDI）测评中心。中心初创的目的就在于为企业的员工招募、员工晋升和雇员管理发展各方面提供行为测评数据。</p><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; line-height: 30px; text-indent: 2em; text-align: justify; color: rgb(90, 90, 90); font-size: 14px;\">NO2 托马斯国际 作为全球领先的个人及组织诊断与发展解决方案供应商，我们长期为客户提供人才测评、评价中心、组织诊断、个人及组织发展等专业领域的咨询服务。托马斯国际的管理服务系统已经在工业领域应用发展了五十年之久，取得了显著的商业成就。我们在全球为75 000多家公司、60多个国家地区提供服务，中国总部位于北京。 凭借全球领先的评价技术及管理专家、丰富的国际化及本土服务经验，托马斯国际在全球范围内为企业组织广泛地提供招募与选拔、人才储备、培训与发展方面的解决方案。中国是托马斯国际第50个正式登陆并提供本土化服务的国家。</p><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; line-height: 30px; text-indent: 2em; text-align: justify; color: rgb(90, 90, 90); font-size: 14px;\">NO2 托马斯国际 作为全球领先的个人及组织诊断与发展解决方案供应商，我们长期为客户提供人才测评、评价中心、组织诊断、个人及组织发展等专业领域的咨询服务。托马斯国际的管理服务系统已经在工业领域应用发展了五十年之久，取得了显著的商业成就。我们在全球为75 000多家公司、60多个国家地区提供服务，中国总部位于北京。 凭借全球领先的评价技术及管理专家、丰富的国际化及本土服务经验，托马斯国际在全球范围内为企业组织广泛地提供招募与选拔、人才储备、培训与发展方面的解决方案。中国是托马斯国际第50个正式登陆并提供本土化服务的国家。</p><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; line-height: 30px; text-indent: 2em; text-align: justify; color: rgb(90, 90, 90); font-size: 14px;\">NO2 托马斯国际 作为全球领先的个人及组织诊断与发展解决方案供应商，我们长期为客户提供人才测评、评价中心、组织诊断、个人及组织发展等专业领域的咨询服务。托马斯国际的管理服务系统已经在工业领域应用发展了五十年之久，取得了显著的商业成就。我们在全球为75 000多家公司、60多个国家地区提供服务，中国总部位于北京。 凭借全球领先的评价技术及管理专家、丰富的国际化及本土服务经验，托马斯国际在全球范围内为企业组织广泛地提供招募与选拔、人才储备、培训与发展方面的解决方案。中国是托马斯国际第50个正式登陆并提供本土化服务的国家。</p>',NULL,'1',NULL,'0','2020-03-22 15:14:05','2020-03-22 15:14:05'), ('2','人才管理这一概念','实打实','大大','2',NULL,'/image/brand/2020/03/22/15/7aa94cf8-a9dc-476f-9e01-ddcb3a7fd89b.jpg','<img src=\"data:image/jpeg;base64,\"><div><p style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Heiti SC&quot;, &quot;Microsoft YaHei&quot;, &quot;WenQuanYi Micro Hei&quot;, sans-serif; line-height: 30px; text-indent: 2em; text-align: justify; color: rgb(90, 90, 90); font-size: 14px;\">人才管理这一概念是出现于90年代，许多企业用来招募、发展和保留人才，通过人才来驱动公司的业绩。21世纪对TM有不同的定义：Morton（2006）描述了人才管理活动的八个类别：招聘，保留，发展，领导力开发，绩效管理，雇员反馈/测量，人才规划与文化。Fitz-enz (2005)认为人才管理囊括了六个人力资源服务：聘用与安置, 领导力发展，继任，绩效管理，培训和教育以及保留。 Farley (2005) 提出，人才管理是发挥员工价值的一套