90, 90); font-size: 14px;\">NO2 托马斯国际 作为全球领先的个人及组织诊断与发展解决方案供应商，我们长期为客户提供人才测评、评价中心、组织诊断、个人及组织发展等专业领域的咨询服务。托马斯国际的管理服务系统已经在工业领域应用发展了五十年之久，取得了显著的商业成就。我们在全球为75 000多家公司、60多个国家地区提供服务，中国总部位于北京。 凭借全球领先的评价技术及管理专家、丰富的国际化及本土服务经验，托马斯国际在全球范围内为企业组织广泛地提供招募与选拔、人才储备、培训与发展方面的解决方案。中国是托马斯国际第50个正式登陆并提供本土化服务的国家。</p>',NULL,'1',NULL,'0','2020-03-22 15:14:05','2020-03-22 15:14:05'), ('13','主动拥抱“互联网+” 推进互联网城市建设','互联网+','互联网+','2',NULL,'/image/brand/2020/03/22/15/bbcec8db-eda1-4422-9340-97a71ccb4662.jpg','<p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><img src=\"data:image/jpeg;base64,\"><strong><br></strong></p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>什么是互联网城市？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网城市是个新概念。目前为止，国内还没有一个统一的说法，也没有一个统一的标准，所以说，我们提出要打造互联网城市，是一次探索，是一次创新，是一次尝试。我认为，互联网城市是对石嘴山市经济发展、社会治理、民生保障、公共服务的全方位应用和深度融合，来促进产业、民生、生态“三大转型”。我们要用“互联网+”这种全新的思维方式、生产方式、生活方式，来推动商业模式的转变和新兴产业的发展。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>建设互联网城市需要什么样的思维？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网是管理治理城市的重要抓手和载体，互联网城市思维是城市建设和发展的新思维。我们要把互联网城市建设作为一项民生工程、民心工程，领导干部要借助互联网转变工作思维，善于运用互联网城市思维让工作串起来、民心连起来、经济活起来。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">一是从点线思维向系统思维转变。互联网城市建设工作我们一直在做，但还没有形成合力和体系，今后我们要在做好点线工作的同时要强调系统性，注重内外对比、及时跟进、统筹推进，要主动变革求新，真正做到高起点规划、高质量落地，力争再打造一个“网上石嘴山”。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">二是从守成思维向创新思维转变。互联网城市建设主线是做好“互联网+”，关键是加什么、怎么加？守成只能固步自封，更谈不上抢抓机遇赶超发展。这就要求我们要做好研究工作，以科学创新的方法开展互联网城市建设工作，要在线上实现城市发展的弯道超车、换道超车和借道超车，努力在宁夏和西部地区打造出互联网城市的“石嘴山样板”。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">三是从传统思维向导向思维转变。互联网城市建设是一项需要全员参与、多方协同的宏大的系统工程，广大领导干部要转变观念，善学活用，用“互联网+”的办法解决以前难以解决和突破的瓶颈问题。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>石嘴山市打造互联网城市，会在哪些领域做好实践？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>发展“互联网+”经济是经济转型升级的重要路径，是经济增长的“倍增器”、经济发展方式的“转换器”、产业升级的“助推器”。而作为“互联网+”与各领域全方位深度融合的互联网城市，到底该做哪些东西？打造什么？发展什么？并没有统一的标准，也没有量化的指标，我们要在学习先进地区经验的基础上，边模仿边实践、边借鉴边探索、边提炼边创新。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">一、“互联网+”制造业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">石嘴山是传统工业城市，制造业是我们的根本，没有制造业的转型就没有经济升级版。特别是我们面广量大的中小企业，它迫切需要通过互联网的应用、信息化的推广，加快传统产业与互联网的融合发展，来零距离对接供给侧和消费端，大幅度提升企业的核心竞争力。所以说，如何来引导我们的工业企业插上“互联网+”的新翅膀，是关键问题。我认为要在制造环节、管理环节、销售环节三个环节上重点运用。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">二、 “互联网+”服务业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">服务业发展水平不高，是石嘴山市目前最大的短板之一。服务业具有带动力强、就业率高、税收高的特点，尤其是以插上互联网翅膀的全域旅游、信息服务、科技金融、现代物流、现代商贸等现代服务业，是发达地区拉动经济转型发展的重要支撑点，也是我们未来发展的重点，要推进新兴服务业和现代服务业快速发展。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">三、 “互联网+”现代农业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">石嘴山市的农业与二、三产业融合度不够，这些结构性的矛盾如何来破解？答案是加快发展“互联网+现代农业”。要综合运用互联网新思维、新技术、新模式，来倒逼改造农业生产、经营和管理方式，促进农业标准化、规模化、品牌化发展。主要思路是要抓好加快农村电商全域化发展，推广农业“互联网+物联网”生产模式，实施“互联网+”农产品区域公用品牌计划。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">四、“互联网+”民生服务</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">改善民生是我们一切工作的出发点和落脚点，这是最终目标。百姓的需求在不断提高，我们政府在民生服务方面的供给也要不断创新，要运用“互联网+”，促进公共资源共享，以更加便捷、便民的服务方式，提升政府的效率，让老百姓拥有更多城市服务的获得感和幸福感。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">五 、“互联网+”社会治理</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">随着科技的迅速发展，互联网全面普及，对我们的社会治理带来了严峻考验和挑战。这些问题，因为科技进步、因为网络发展而产生，也只能由科技和网络的方法来解决。比如，社会治安和公共安全问题，要加快实施天网工程、雪亮工程，推进公共安全视频监控建设联网应用，建设纵向贯通县、乡、村、院落四级网格，横向联通公共安全视频监控系统，实现统筹协调一体化；建设覆盖全市居民小区、公共场所、道路卡口的智能图控系统，提升对社会治安形势掌控与应急处置能力。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>建设互联网城市，政府应做好哪些方面工作？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网城市建设是个大概念，是个系统工程，需要政府、企业、社会全面参与共建。这里面，企业和社会是主要力量，政府是“风向标”“催化剂”“定心丸”的角色，主要做好顶层设计、基础配套和精准服务，既不能缺位，也不能越位。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">总之，面对“互联网+”这个全新的事业，我们一定要转变思维方式，借鉴成功经验，掌握发展规律，集中各界智慧，打造出宁夏和西部地区互联网城市的“石嘴山样板”。</p>',NULL,'2',NULL,'0','2020-03-22 15:14:25','2020-03-22 15:14:25'), ('14','主动拥抱“互联网+” 推进互联网城市建设','互联网+','互联网+','2',NULL,'/image/brand/2020/03/22/15/bbcec8db-eda1-4422-9340-97a71ccb4662.jpg','<p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><img src=\"data:image/jpeg;base64,\"><strong><br></strong></p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>什么是互联网城市？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网城市是个新概念。目前为止，国内还没有一个统一的说法，也没有一个统一的标准，所以说，我们提出要打造互联网城市，是一次探索，是一次创新，是一次尝试。我认为，互联网城市是对石嘴山市经济发展、社会治理、民生保障、公共服务的全方位应用和深度融合，来促进产业、民生、生态“三大转型”。我们要用“互联网+”这种全新的思维方式、生产方式、生活方式，来推动商业模式的转变和新兴产业的发展。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>建设互联网城市需要什么样的思维？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网是管理治理城市的重要抓手和载体，互联网城市思维是城市建设和发展的新思维。我们要把互联网城市建设作为一项民生工程、民心工程，领导干部要借助互联网转变工作思维，善于运用互联网城市思维让工作串起来、民心连起来、经济活起来。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">一是从点线思维向系统思维转变。互联网城市建设工作我们一直在做，但还没有形成合力和体系，今后我们要在做好点线工作的同时要强调系统性，注重内外对比、及时跟进、统筹推进，要主动变革求新，真正做到高起点规划、高质量落地，力争再打造一个“网上石嘴山”。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">二是从守成思维向创新思维转变。互联网城市建设主线是做好“互联网+”，关键是加什么、怎么加？守成只能固步自封，更谈不上抢抓机遇赶超发展。这就要求我们要做好研究工作，以科学创新的方法开展互联网城市建设工作，要在线上实现城市发展的弯道超车、换道超车和借道超车，努力在宁夏和西部地区打造出互联网城市的“石嘴山样板”。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">三是从传统思维向导向思维转变。互联网城市建设是一项需要全员参与、多方协同的宏大的系统工程，广大领导干部要转变观念，善学活用，用“互联网+”的办法解决以前难以解决和突破的瓶颈问题。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>石嘴山市打造互联网城市，会在哪些领域做好实践？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>发展“互联网+”经济是经济转型升级的重要路径，是经济增长的“倍增器”、经济发展方式的“转换器”、产业升级的“助推器”。而作为“互联网+”与各领域全方位深度融合的互联网城市，到底该做哪些东西？打造什么？发展什么？并没有统一的标准，也没有量化的指标，我们要在学习先进地区经验的基础上，边模仿边实践、边借鉴边探索、边提炼边创新。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">一、“互联网+”制造业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">石嘴山是传统工业城市，制造业是我们的根本，没有制造业的转型就没有经济升级版。特别是我们面广量大的中小企业，它迫切需要通过互联网的应用、信息化的推广，加快传统产业与互联网的融合发展，来零距离对接供给侧和消费端，大幅度提升企业的核心竞争力。所以说，如何来引导我们的工业企业插上“互联网+”的新翅膀，是关键问题。我认为要在制造环节、管理环节、销售环节三个环节上重点运用。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">二、 “互联网+”服务业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">服务业发展水平不高，是石嘴山市目前最大的短板之一。服务业具有带动力强、就业率高、税收高的特点，尤其是以插上互联网翅膀的全域旅游、信息服务、科技金融、现代物流、现代商贸等现代服务业，是发达地区拉动经济转型发展的重要支撑点，也是我们未来发展的重点，要推进新兴服务业和现代服务业快速发展。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">三、 “互联网+”现代农业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">石嘴山市的农业与二、三产业融合度不够，这些结构性的矛盾如何来破解？答案是加快发展“互联网+现代农业”。要综合运用互联网新思维、新技术、新模式，来倒逼改造农业生产、经营和管理方式，促进农业标准化、规模化、品牌化发展。主要思路是要抓好加快农村电商全域化发展，推广农业“互联网+物联网”生产模式，实施“互联网+”农产品区域公用品牌计划。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">四、“互联网+”民生服务</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">改善民生是我们一切工作的出发点和落脚点，这是最终目标。百姓的需求在不断提高，我们政府在民生服务方面的供给也要不断创新，要运用“互联网+”，促进公共资源共享，以更加便捷、便民的服务方式，提升政府的效率，让老百姓拥有更多城市服务的获得感和幸福感。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">五 、“互联网+”社会治理</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">随着科技的迅速发展，互联网全面普及，对我们的社会治理带来了严峻考验和挑战。这些问题，因为科技进步、因为网络发展而产生，也只能由科技和网络的方法来解决。比如，社会治安和公共安全问题，要加快实施天网工程、雪亮工程，推进公共安全视频监控建设联网应用，建设纵向贯通县、乡、村、院落四级网格，横向联通公共安全视频监控系统，实现统筹协调一体化；建设覆盖全市居民小区、公共场所、道路卡口的智能图控系统，提升对社会治安形势掌控与应急处置能力。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>建设互联网城市，政府应做好哪些方面工作？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网城市建设是个大概念，是个系统工程，需要政府、企业、社会全面参与共建。这里面，企业和社会是主要力量，政府是“风向标”“催化剂”“定心丸”的角色，主要做好顶层设计、基础配套和精准服务，既不能缺位，也不能越位。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">总之，面对“互联网+”这个全新的事业，我们一定要转变思维方式，借鉴成功经验，掌握发展规律，集中各界智慧，打造出宁夏和西部地区互联网城市的“石嘴山样板”。</p>',NULL,'2',NULL,'0','2020-03-22 15:14:25','2020-03-22 15:14:25'), ('15','主动拥抱“互联网+” 推进互联网城市建设','互联网+','互联网+','2',NULL,'/image/brand/2020/03/22/15/bbcec8db-eda1-4422-9340-97a71ccb4662.jpg','<p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><img src=\"data:image/jpeg;base64,\"><strong><br></strong></p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>什么是互联网城市？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网城市是个新概念。目前为止，国内还没有一个统一的说法，也没有一个统一的标准，所以说，我们提出要打造互联网城市，是一次探索，是一次创新，是一次尝试。我认为，互联网城市是对石嘴山市经济发展、社会治理、民生保障、公共服务的全方位应用和深度融合，来促进产业、民生、生态“三大转型”。我们要用“互联网+”这种全新的思维方式、生产方式、生活方式，来推动商业模式的转变和新兴产业的发展。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>建设互联网城市需要什么样的思维？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网是管理治理城市的重要抓手和载体，互联网城市思维是城市建设和发展的新思维。我们要把互联网城市建设作为一项民生工程、民心工程，领导干部要借助互联网转变工作思维，善于运用互联网城市思维让工作串起来、民心连起来、经济活起来。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">一是从点线思维向系统思维转变。互联网城市建设工作我们一直在做，但还没有形成合力和体系，今后我们要在做好点线工作的同时要强调系统性，注重内外对比、及时跟进、统筹推进，要主动变革求新，真正做到高起点规划、高质量落地，力争再打造一个“网上石嘴山”。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">二是从守成思维向创新思维转变。互联网城市建设主线是做好“互联网+”，关键是加什么、怎么加？守成只能固步自封，更谈不上抢抓机遇赶超发展。这就要求我们要做好研究工作，以科学创新的方法开展互联网城市建设工作，要在线上实现城市发展的弯道超车、换道超车和借道超车，努力在宁夏和西部地区打造出互联网城市的“石嘴山样板”。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">三是从传统思维向导向思维转变。互联网城市建设是一项需要全员参与、多方协同的宏大的系统工程，广大领导干部要转变观念，善学活用，用“互联网+”的办法解决以前难以解决和突破的瓶颈问题。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>石嘴山市打造互联网城市，会在哪些领域做好实践？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>发展“互联网+”经济是经济转型升级的重要路径，是经济增长的“倍增器”、经济发展方式的“转换器”、产业升级的“助推器”。而作为“互联网+”与各领域全方位深度融合的互联网城市，到底该做哪些东西？打造什么？发展什么？并没有统一的标准，也没有量化的指标，我们要在学习先进地区经验的基础上，边模仿边实践、边借鉴边探索、边提炼边创新。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">一、“互联网+”制造业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">石嘴山是传统工业城市，制造业是我们的根本，没有制造业的转型就没有经济升级版。特别是我们面广量大的中小企业，它迫切需要通过互联网的应用、信息化的推广，加快传统产业与互联网的融合发展，来零距离对接供给侧和消费端，大幅度提升企业的核心竞争力。所以说，如何来引导我们的工业企业插上“互联网+”的新翅膀，是关键问题。我认为要在制造环节、管理环节、销售环节三个环节上重点运用。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">二、 “互联网+”服务业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">服务业发展水平不高，是石嘴山市目前最大的短板之一。服务业具有带动力强、就业率高、税收高的特点，尤其是以插上互联网翅膀的全域旅游、信息服务、科技金融、现代物流、现代商贸等现代服务业，是发达地区拉动经济转型发展的重要支撑点，也是我们未来发展的重点，要推进新兴服务业和现代服务业快速发展。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">三、 “互联网+”现代农业</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">石嘴山市的农业与二、三产业融合度不够，这些结构性的矛盾如何来破解？答案是加快发展“互联网+现代农业”。要综合运用互联网新思维、新技术、新模式，来倒逼改造农业生产、经营和管理方式，促进农业标准化、规模化、品牌化发展。主要思路是要抓好加快农村电商全域化发展，推广农业“互联网+物联网”生产模式，实施“互联网+”农产品区域公用品牌计划。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">四、“互联网+”民生服务</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">改善民生是我们一切工作的出发点和落脚点，这是最终目标。百姓的需求在不断提高，我们政府在民生服务方面的供给也要不断创新，要运用“互联网+”，促进公共资源共享，以更加便捷、便民的服务方式，提升政府的效率，让老百姓拥有更多城市服务的获得感和幸福感。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">五 、“互联网+”社会治理</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">随着科技的迅速发展，互联网全面普及，对我们的社会治理带来了严峻考验和挑战。这些问题，因为科技进步、因为网络发展而产生，也只能由科技和网络的方法来解决。比如，社会治安和公共安全问题，要加快实施天网工程、雪亮工程，推进公共安全视频监控建设联网应用，建设纵向贯通县、乡、村、院落四级网格，横向联通公共安全视频监控系统，实现统筹协调一体化；建设覆盖全市居民小区、公共场所、道路卡口的智能图控系统，提升对社会治安形势掌控与应急处置能力。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>人民网：</strong>建设互联网城市，政府应做好哪些方面工作？</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\"><strong>李郁华：</strong>互联网城市建设是个大概念，是个系统工程，需要政府、企业、社会全面参与共建。这里面，企业和社会是主要力量，政府是“风向标”“催化剂”“定心丸”的角色，主要做好顶层设计、基础配套和精准服务，既不能缺位，也不能越位。</p><p style=\"margin-top: 25px; margin-bottom: 25px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 32.4px; font-family: 微软雅黑; text-indent: 2em; color: rgb(34, 34, 34);\">总之，面对“互联网+”这个全新的事业，我们一定要转变思维方式，借鉴成功经验，掌握发展规律，集中各界智慧，打造出宁夏和西部地区互联网城市的“石嘴山样板”。</p>',NULL,'2',NULL,'0','2020-03-22 15:14:25','2020-03-22 15:14:25');
