INSERT INTO `t_product` VALUES ('1','人力资源','人力资源','人力资源','0','/image/brand/2020/03/22/15/abcf3ab4-dae5-4075-af33-a4ab15b25c2e.jpg','<img src=\"data:image/jpeg;base64,\"><div><br></div><div><div><b>人力资源</b></div><div>境内职业介绍，劳务派遣经营、人力资源管理服务是名爵的人力资源服务。</div><div><br></div><div>境内职业介绍：</div><div>(1)信息服务。包括信息收集、信息交流与信息发布等。</div><div><br></div><div>(2)咨询服务。包括就业政策法规及服务咨询、职业培训信息咨询、求职和用人咨询、个人开业咨询和企业劳动人事管理咨询等。</div><div><br></div><div>(3)指导服务。包括职业能力测试评估、职业分析与评价、职业生涯设计、求职及用人观念和方法指导等。</div><div><br></div><div>(4)介绍服务。包括求职和用人面谈、介绍就业和推荐用人、举办招聘洽谈会、引导劳动者流动就业等。</div><div><br></div><div>(5)接受委托。包括受用人单位委托组织招聘、受求职人员委托存放档案，以及受劳动保障行政部门委托，办理劳动合同鉴证及有关职业培训和社会保险等事务。</div><div><br></div><div>(6)管理服务。包括就业登记、单位用人备案、职业介绍服务中的争议处理、协助进行劳动力市场监督检查、协助组织和管理劳动者流动就业等。</div><div><br></div><div><b>劳务派遣经营：</b></div><div>简化管理程序，减少劳动争议，分担风险和责任，降低成本费用，自主灵活用工，规范用工行为</div><div><br></div><div>第一，“不求所有，但求所用”</div><div><br></div><div>第二，“你用人，我管人”</div><div><br></div><div>第三，名爵“一手托两家”，更有利于劳务供需双方的双向选择和有关各方责权利的保障</div><div><br></div><div><b>人力资源管理:</b></div><div>一：低成本管理战略</div><div><br></div><div>二：集中一点管理战略</div></div>','1','0','2018-03-08 09:44:20','2020-03-22 15:41:05'), ('2','咨询服务','咨询服务','咨询服务','0','/image/brand/2020/03/22/15/1a1c2617-2278-4840-9e61-66abf1d58964.jpg','<div><img src=\"data:image/jpeg;base64,\"><br></div><div>&nbsp; &nbsp;<b>咨询服务:</b><div><div class=\"col-sm-9\"><br></div><div class=\"col-sm-9\">企业管理咨询服务，法律咨询服务是名爵的咨询服务</div><div class=\"col-sm-9\"><br></div><div class=\"col-sm-9\">企业管理咨询服务</div><div class=\"col-sm-9\">一是帮助企业发现生产经营管理上的主要问题，找出原因，制定切实可行的改善方案；</div><div class=\"col-sm-9\"><br></div><div class=\"col-sm-9\">二是指导改善方案的实施；</div><div class=\"col-sm-9\"><br></div><div class=\"col-sm-9\">三是传授经营管理的理论与科学方法，培训企业各级管理干部，从根本上提高企业的素质。</div><div class=\"col-sm-9\"><br></div><div class=\"col-sm-9\"><b>法律咨询服务:</b></div><div class=\"col-sm-9\">提供专业律师，就有关法律事务问题作出解释、说明，提出建议和解决方案</div></div></div>','2','0','2018-03-09 16:36:08','2020-03-22 15:41:26'), ('3','室内装潢','室内装潢','室内装潢','0','/image/brand/2020/03/22/15/6ed0b074-d9b5-479f-b851-2a8122937606.jpg','<img src=\"data:image/jpeg;base64,\"><div><br></div><div><div><b>室内装潢</b></div><div>室内外装潢设计、施工及服务，装饰材料、建筑材料的销售是名爵的室内装潢服务。</div><div><br></div><div><b>室内外装潢设计：</b></div><div>根据室内的使用性质、环境和相应的标准，运用物质手段和建筑美学原理，给人创造一种合理、舒适、优美能满足人们物质和精神需要的室内环境</div><div><br></div><div><b>室内外装潢施工及服务：</b></div><div>提供优质的施工服务</div><div><br></div><div><b>装饰材料、建筑材料的销售：</b></div><div>地面装饰材料，包括水泥，大理石，木地板等</div><div><br></div><div>内墙装饰材料，包括石灰墙纸等</div><div><br></div><div>外墙装饰材料，水泥砂浆、剁假石、水刷石、釉面砖、软瓷外墙砖等</div><div><br></div><div>新型装饰材料</div></div>','3','0','2020-03-22 00:00:00','2020-03-22 15:28:46'), ('4','电子销售','电子销售','电子销售','0','/image/brand/2020/03/23/00/d0adc4cd-0ea8-4d1d-aa01-faf108015012.jpg','<div><img src=\"data:image/jpeg;base64,\"><br></div><div><div>电子销售</div><div>通过业务的营销手段达到电子产品的销售目的</div></div>','4','0','2018-03-09 16:39:43','2020-03-23 00:20:14'), ('5','眼眼微信','微信公众号,微信服务号开发,微信网站开发,西安微信公众号','科技软件技术有限公司微信公众号开发','1','/image/brand/2020/03/22/16/5d8e6269-2e80-4b82-878d-96ab7d63f746.jpg','<div><img src=\"data:image/png;base64,\"><br></div>微信公众号开发','1','0','2018-05-18 11:19:39','2020-03-22 16:50:50'), ('6','未来集市','思埠微商教你如何做好售前','思埠未来集市社交电商微商创业平台，超级红利期席卷微商界！加入第一批未来集市享受第一批创业新浪潮！未来集市是什么靠谱吗，怎么注册赚钱，邀请码是什么，怎么样做和加入，是什么样的创业平台，本站为大家介绍！','0','/image/brand/2020/03/22/18/0861d86b-14e2-4621-a9a1-7dd0bad0f6f6.jpg','<div><img src=\"data:image/jpeg;base64,\"><br></div>思埠未来集市社交电商微商创业平台，超级红利期席卷微商界！加入第一批未来集市享受第一批创业新浪潮！未来集市是什么靠谱吗，怎么注册赚钱，邀请码是什么，怎么样做和加入，是什么样的创业平台，本站为大家介绍！','5','0','2020-03-22 15:52:48','2020-03-22 18:21:23'), ('7','眼康微信','微信公众号,微信服务号开发,微信网站开发,西安微信公众号','科技软件技术有限公司微信公众号开发','1','/image/brand/2020/03/22/16/1e57855b-4a24-4c49-aa55-7d3bcc3d3726.png','<img src=\"data:image/jpeg;base64,\">','1','0','2018-05-18 11:19:39','2020-03-22 16:35:33'), ('8','技术服务','技术服务','技术服务','0','/image/brand/2020/03/22/15/abcf3ab4-dae5-4075-af33-a4ab15b25c2e.jpg','<img src=\"data:image/jpeg;base64,\"><div><br></div><div><div><b>人力资源</b></div><div>境内职业介绍，劳务派遣经营、人力资源管理服务是名爵的人力资源服务。</di